import React from 'react'
import { useSelector } from 'react-redux'

export default function Fieldstable() {

    const fields = JSON.parse(useSelector((state) => state.dataReducer.selectedFields[0].fields))

    return (
        <div className="table-container bottom-table">

            <table className="fields-table">
                <thead>
                    <tr className="heading-tr">
                        <th>Name</th>
                        <th>Nullable</th>
                        <th>Data Type</th>
                        {/* <th>Value Type</th> */}
                        <th>Description</th>
                        <th>Is PII</th>
                        <th>Is Computed</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        fields.map(item => {
                            return (
                                <tr>
                                    <td>{item.name}</td>
                                    <td>{item.nullable}</td>
                                    <td>{item.datatype}</td>
                                    {/* <td>{item.value_type}</td> */}
                                    {/* display:"inline-block" */}
                                    <td>
                                        <div className="description">
                                            {
                                                (item.description.length >= 70) ? item.description.substring(0, 64) + " ...." : item.description
                                            }
                                            {
                                                item.description.length >= 70 &&
                                                <p className="tool-tip">{item.description}</p>
                                            }
                                        </div>
                                    </td>
                                    <td>{JSON.stringify(item.isPII)}</td>
                                    <td>{JSON.stringify(item.isComputed)}</td>
                                </tr>
                            )
                        }
                        )
                    }
                </tbody>
            </table>
        </div>
    )
}
